    NSString* doctorId = @"23147";
    NSString* address = @"address";
    NSString* addressDetails = @"address details";
    NSString* mobileNumber = @"01003498776";
    NSString* patientLatitude = @"3.15455655";
    NSString* patientLongitude = @"32.4545455";

    // Set callback and perform API call
    [self.controller createReservationRequestAsyncWithXAuthenticationToken: xAuthenticationToken xSessionId : xSessionId xAppId : xAppId doctorId : doctorId address : address addressDetails : addressDetails mobileNumber : mobileNumber patientLatitude : patientLatitude patientLongitude : patientLongitude  completionBlock:^(BOOL success, HttpContext* context, NSError* error) { 
       // Test response code
        XCTAssertEqual(200, context.response.statusCode);
        

        [expectation fulfill];
    }];
    [self wait];
}

